    const [state, setState] = useState("state");

    const loadDataOnlyOnce = useCallback(() => {
        console.log(`I need ${state}!!`);
    }, [state]);

    useEffect(() => {
        loadDataOnlyOnce(); // this will fire only when loadDataOnlyOnce-reference changes
    }, [loadDataOnlyOnce]);
    return ('pepe');
}
